<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>WinLibs</b> est un compilateur C et C++ gratuit pour Microsoft Windows.

GCC (GNU Compiler Collection) est un compilateur libre et open source pour C et C++ (et d'autres langages comme Objective-C, Fortran, D).
MinGW-w64 est une bibliothèque C et C++ gratuite et open source pour cibler les plates-formes Windows 32 bits et 64 bits.
La combinaison de ces résultats dans un compilateur C/C++ gratuit pour Windows.
Même si GCC et MinGW-w64 peuvent être utilisés sur d'autres plateformes (par exemple Linux) pour générer des exécutables Windows, le projet WinLibs se concentre uniquement sur la construction de versions qui s'exécutent nativement sur Windows.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="installation-de-winlibs">Installation de WinLibs</a>
</h1>
<div class="Section6"><br>Télécharger WinLibs.<br><br><a class="GLink3 Link4" style=" color: lime;" href="https://winlibs.com/" target="_blank">https://winlibs.com/</a><br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Décompresser le fichier archive.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Installer le dans un répertoire selon votre choix.</div>
</div><br>L'utilitaire (gcc) permet de compiler un programme C.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">@echo off
::===============================================
set "PATH=C:\Users\admin\dev\bin\winlibs\mingw64\bin"
::===============================================
gcc -c main.c -o main.o
gcc -o rdv_c.exe main.o
rdv_c.exe
::===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="bibliotheque-statique">Bibliothèque statique</a>
</h1>
<div class="Section6"><br>L'utilitaire (ar) permet de créer une bibliothèque statique.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">@echo off
::===============================================
set "PATH=C:\Users\admin\dev\winlibs\mingw64\bin"
::===============================================
gcc -c GHello.c -o GHello.o -I.
gcc -c GMath.c -o GMath.o  -I.
ar rcs libhello.a GHello.o GMath.o
::===============================================</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>L'utilitaire (gcc) permet de lier une bibliothèque statique.&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">@echo off
::===============================================
set "PATH=C:\Users\admin\dev\winlibs\mingw64\bin"
::===============================================
gcc -c main.c -o main.o -I.
gcc -o rdvc.exe main.o -L. -lhello
::===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="bibliotheque-dynamique">Bibliothèque dynamique</a>
</h1>
<div class="Section6"><br>L'utilitaire (gcc) permet de créer une bibliothèque dynamique.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">@echo off
::===============================================
set "PATH="
set "PATH=C:\Users\admin\dev\winlibs\mingw64\bin;%PATH%"
set "PATH=bin;%PATH%"
::===============================================
if not exist bin ( mkdir bin )
if not exist lib ( mkdir lib )
if not exist build ( mkdir build )
::===============================================
gcc -c GHello.c -o build/GHello.o
gcc -shared -o lib/libhello.dll.a build/GHello.o
::===============================================
gcc -c main.c -o build/main.o
gcc -o bin/rdv_c.exe build/main.o -Llib -lhello
::===============================================
bin\rdv_c.exe
::===============================================</pre><br>Ce qu'il faut savoir:<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">option (shared) ---&gt; pour bibliothèque dynamique
</pre><br></div>
</div>
